function commonDenominators(){let e=[];const r=Array.from(new Set(Object.values(arguments).filter(e=>Number.isInteger(e)&&e>0))).sort((e,r)=>e-r);Array.from(new Set(r.reduce((e,r,n,t)=>{let o=t[0];while(o>0){r%o===0&&t[0]%o===0?e.push(o):null;o--}return e},[]).sort((e,r)=>e-r))).reduce((n,t)=>{r.forEach(e=>{e%t===0?n++:false});n===r.length?e.push(t):null;return n=0},0);return e}module.exports=commonDenominators;